Using function in the chat completions API (Deprecated)Function calling is available in the `2023-07-01-preview` API version and works with version 0613 of gpt-35-turbo, gpt-35-turbo-16k, gpt-4, and gpt-4-32k.To use function calling with the Chat Completions API, you need to include two new properties in your request: `functions` and `function_call`. You can include one or more `functions` in your request and you can learn more about how to define functions in the defining functions section. Keep in mind that functions are injected into the system message under the hood so functions count against your token usage.When functions are provided, by default the `function_call` is set to `"auto"` and the model decides whether or not a function should be called. Alternatively, you can set the `function_call` parameter to `{"name": "<insert-function-name>"}` to force the API to call a specific function or you can set the parameter to `"none"` to prevent the model from calling any functions.# OpenAI Python 0.28.1[!INCLUDE Deprecation]```pythonimport osimport openaiopenai.api_key = os.getenv("AZURE_OPENAI_API_KEY")openai.api_version = "2023-07-01-preview"openai.api_type = "azure"openai.api_base = os.getenv("AZURE_OPENAI_ENDPOINT")messages= [    {"role": "user", "content": "Find beachfront hotels in San Diego for less than $300 a month with free breakfast."}]functions= [      {        "name": "search_hotels",        "description": "Retrieves hotels from the search index based on the parameters provided",        "parameters": {            "type": "object",            "properties": {                "location": {                    "type": "string",                    "description": "The location of the hotel (i.e. Seattle, WA)"                },                "max_price": {                    "type": "number",                    "description": "The maximum price for the hotel"                },                "features": {                    "type": "string",                    "description": "A comma separated list of features (i.e. beachfront, free wifi, etc.)"                }            },            "required": ["location"]        }    }]  response = openai.ChatCompletion.create(    engine="gpt-35-turbo-0613", # engine = "deployment_name"    messages=messages,    functions=functions,    function_call="auto", )print(response['choices'][0]['message'])``````json{  "role": "assistant",  "function_call": {    "name": "search_hotels",    "arguments": "{
  "location": "San Diego",
  "max_price": 300,
  "features": "beachfront,free breakfast"
}"  }}```# OpenAI Python 1.x```pythonimport osfrom openai import AzureOpenAIclient = AzureOpenAI(  api_key=os.getenv("AZURE_OPENAI_API_KEY"),    api_version="2023-10-01-preview",  azure_endpoint = os.getenv("AZURE_OPENAI_ENDPOINT"))messages= [    {"role": "user", "content": "Find beachfront hotels in San Diego for less than $300 a month with free breakfast."}]functions= [      {        "name": "search_hotels",        "description": "Retrieves hotels from the search index based on the parameters provided",        "parameters": {            "type": "object",            "properties": {                "location": {                    "type": "string",                    "description": "The location of the hotel (i.e. Seattle, WA)"                },                "max_price": {                    "type": "number",                    "description": "The maximum price for the hotel"                },                "features": {                    "type": "string",                    "description": "A comma separated list of features (i.e. beachfront, free wifi, etc.)"                }            },            "required": ["location"]        }    }]  response = client.chat.completions.create(    model="gpt-35-turbo-0613", # model = "deployment_name"    messages= messages,    functions = functions,    function_call="auto",)print(response.choices[0].message.model_dump_json(indent=2))``````json{  "content": null,  "role": "assistant",  "function_call": {    "arguments": "{
  "location": "San Diego",
  "max_price": 300,
  "features": "beachfront, free breakfast"
}",    "name": "search_hotels"  }}```# PowerShell```powershell-interactive$openai = @{    api_key     = $Env:AZURE_OPENAI_API_KEY    api_base    = $Env:AZURE_OPENAI_ENDPOINT # should look like https:/YOUR_RESOURCE_NAME.openai.azure.com/    api_version = '2023-10-01-preview' # may change in the future    name        = 'YOUR-DEPLOYMENT-NAME-HERE' # the custom name you chose for your deployment}$headers = [ordered]@{   'api-key' = $openai.api_key}$messages   = @()$messages  += [ordered]@{    role    = 'user'    content = 'Find beachfront hotels in San Diego for less than $300 a month with free breakfast.'}$functions  = @()$functions += [ordered]@{    name        = 'search_hotels'    description = 'Retrieves hotels from the search index based on the parameters provided'    parameters  = @{        type = 'object'        properties = @{            location = @{                type = 'string'                description = 'The location of the hotel (i.e. Seattle, WA)'            }            max_price = @{                type = 'number'                description = 'The maximum price for the hotel'            }            features = @{                type = 'string'                description = 'A comma separated list of features (i.e. beachfront, free wifi, etc.)'            }        }        required = @('location')    }}# these API arguments are introduced in model version 0613$body = [ordered]@{    messages      = $messages    functions         = $functions    function_call   = 'auto'} | ConvertTo-Json -depth 6$url = "$($openai.api_base)/openai/deployments/$($openai.name)/chat/completions?api-version=$($openai.api_version)"$response = Invoke-RestMethod -Uri $url -Headers $headers -Body $body -Method Post -ContentType 'application/json'$response.choices[0].message | ConvertTo-Json``````json{  "role": "assistant",  "function_call": {    "name": "search_hotels",    "arguments": "{
  "max_price": 300,
  "features": "beachfront, free breakfast",
  "location": "San Diego"
}"  }}```---The response from the API includes a `function_call` property if the model determines that a function should be called. The `function_call` property includes the name of the function to call and the arguments to pass to the function. The arguments are a JSON string that you can parse and use to call your function.In some cases, the model generates both `content` and a `function_call`. For example, for the prompt above the content could say something like "Sure, I can help you find some hotels in San Diego that match your criteria" along with the function_call.
